import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <p><img src="https://cdn1.ozone.ru/multimedia/1005972991.jpg" width="400" 
   height="400"/></p>
   <NameOfAlbum name = {"In a time lapse"}/>
   <AlbumArtist artist = {"Ludovico Einaudi"}/>
   <YearOfPublication year = {"21 januare 2013"}/>
   <SongsList songs = {Songs}/>

    </div>
  );
}

function NameOfAlbum(props){
  return(
    <div>
      <h1>{props.name}</h1>
    </div>
  );
}

function AlbumArtist(props){
  return(
    <div>
      <h2>{props.artist}</h2>
    </div>
  );
}
function YearOfPublication(props){
  return(
    <div>
      <h3>{props.year}</h3>
    </div>
  );
}
let Songs = [
  {
    No: 1,
    title: '"Corale"',
    length: '2:05'
  },
  {
    No: 2,
    title: '"Time Lapse"'
  },
  ];
  function SongsList(props) {
    return (
      <div className="songs">
        {props.songs.map((song) => {
          return (
            <div className="song" key={song.name}>
              <h2>{song.name}</h2>
              <ul>
                {song.songs.map((title) => {
                  return (
                    <li key={title}>{title}</li>
                  )
                })}
              </ul>
            </div>
          )
        })}
      </div>
    )
  }
export default App;
